    false,nt"url": null,nt"notes": "This annual narrative report for Kanuti
    NWR outlines Refuge accomplishments during the 1987 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, and compliance with environmental and
    cultural resource mandates. Refuge administration is outlined; information about
    personnel, manpower programs, volunteer programs, funding, and safety is given.
    Habitat management is also covered; subjects include wetlands, forests, fire management,
    water rights, and wilderness areas. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, scientific collections,
    and marking and bird banding. The public uses of the Refuge described in this report
    include interpretive programs, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, equipment replacement, communication
    systems, computer systems, and energy conservation. Cooperative programs are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
